            "description": "(VIDEO PODCAST) Paris Hilton on Call Her Daddy? That’s hot. Join Alex as she goes to Paris Hilton’s house for a sit-down interview. Paris reminisces on some of her most memorable 2000’s moments and what dating was like in her early twenties (hint: you were probably ghosted or blacklisted from every club). She also tells the story behind that iconic photo of her, Lindsay Lohan, and Britney Spears and talks about her long-term friendship with Kim Kardashian. Paris explains how she was typecast as the “dumb blonde” on The Simple Life and how she felt that character defined her for the majority of her career. Alex and Paris also discuss Paris’ leaked sex tape, how that impacted her romantic relationships, and the horrible slut shaming she had to overcome. Finally, Paris gushes over her marriage and how her husband is completely different from anyone she dated in her past. If you want even more of their love story, you can check out season two of Paris in Love now streaming on Peacock. Enjoy! Learn more about your ad choices. Visit podcastchoices.com/adchoices",
